import React from 'react';
import '../css/Snake.css';

function Snake() {
    return (
        <div>
            <div class="questions">
                <p>This is where the questions will go.</p>
                <p>And the options somewhere here.</p>
            </div>
            
            <div class="gameBoard">
            </div>
            
            <div class="score">
                <p>Score: </p>
            </div>
        </div>
    );
}

export default Snake;
